import React from 'react';
import styles from '../css/JobCard.css'; // Import the CSS module

const JobCard = ({ job }) => {
  return (
    <div className={styles['job-card']}>
      <h2 className={styles['job-title']}>{job.title}</h2>
      <p className={styles['company-name']}>{job.company}</p>
      {/* Rest of the job card content */}
    </div>
  );
};

export default JobCard;
